import React, { useEffect,useState } from "react";
import { Loader } from "google-maps";
import { key } from "./misc/config";
import "./App.css";
import Location from "./components/Location";
function App() {
  let google
  let map
  useEffect(async () => {
      const loadMap = async () => {
        const load = new Loader(key.google);
        google = await load.load();
        console.log(google);
        await new google.maps.Map(document.getElementById("map"), {
          center: { lat: 40, lng: -100 },
          scrollwheel: false,
          zoom: 5
        });
      };
    await loadMap()
  }, []);
  return (
    <div className="AppRoot">
      <Location google={map}/>
    </div>
  );
}

export default App;
